function displayErrors(){let e=new URLSearchParams(window.location.search),n=e.get("err"),t=document.getElementById("error");if(n){switch(n){case"0":t.innerText="500 internal server error",t.style.display="unset";case"1":t.innerText="bad email/password",t.style.display="unset";case"2":t.innerText="account not yet approved by an admin",t.style.display="unset"}History.replaceState({},"Login - 766 Scouting",window.location.origin+window.location.pathname)}}